uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameters defined in the JSON
uniform float u_speed;
uniform float u_camera_dist;
uniform float u_fov;
uniform float u_glow_intensity;
uniform float u_leg_length;
uniform float u_leg_thickness;

out vec4 fragColor;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum for organic blending
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// Distance to a line segment (used for legs)
float sdSegment(vec3 p, vec3 a, vec3 b, float r) {
    vec3 pa = p - a, ba = b - a;
    float h = clamp(dot(pa, ba) / dot(ba, ba), 0.0, 1.0);
    return length(pa - ba * h) - r;
}

// --- SHAPES ---
// A twisted "Infinity Bowtie" based on a modified torus
float sdInfinityBowtie(vec3 p) {
    float t = iTime * u_speed * 0.5;

    // Twist the space
    p.xz *= rot(p.y * 0.5 + t);

    // Lemniscate-inspired transformation
    float angle = atan(p.x, p.z);
    float dist = length(p.xz);

    // Pinched radius to create the bowtie effect
    float r1 = 2.5; 
    float r2 = 0.4 + 0.3 * cos(angle * 2.0); // The "pinch"

    // Add vertical oscillation
    p.y += sin(angle * 2.0 + t) * 0.5;

    vec2 q = vec2(dist - r1, p.y);
    return length(q) - r2;
}

// Intelligent Legs Logic
float sdLegs(vec3 p) {
    float d = 1e10;
    float t = iTime * u_speed;
    const int numLegs = 30;

    for(int i = 0; i < numLegs; i++) {
        float fi = float(i);
        // Distribute legs around a circle
        float angle = (fi / float(numLegs)) * 6.28318;

        // Base position on the main body
        float bodyAngle = angle + (iTime * u_speed * 0.1);
        vec3 base = vec3(sin(bodyAngle) * 2.5, sin(bodyAngle * 2.0) * 0.5, cos(bodyAngle) * 2.5);

        // "Intelligent" movement: procedural IK-like reaching
        // Each leg has an individual phase offset
        float phase = t * 2.0 + fi * 1.5;

        // Joint 1: Elbow/Knee
        vec3 joint = base + vec3(
            sin(angle) * u_leg_length * 0.5,
            cos(phase) * 1.2, 
            cos(angle) * u_leg_length * 0.5
        );

        // Joint 2: Tip (reaching for an invisible floor or target)
        vec3 tip = joint + vec3(
            sin(angle + sin(phase)*0.5) * u_leg_length * 0.5,
            -u_leg_length * 0.7 + sin(phase * 0.8) * 0.5,
            cos(angle + sin(phase)*0.5) * u_leg_length * 0.5
        );

        // Combine segments
        float seg1 = sdSegment(p, base, joint, u_leg_thickness);
        float seg2 = sdSegment(p, joint, tip, u_leg_thickness * 0.7);

        d = smin(d, smin(seg1, seg2, 0.1), 0.2);
    }
    return d;
}

// Scene Map
float map(vec3 p) {
    // Subtle world distortion
    float body1 = sdInfinityBowtie(p);
    float body2 = sdInfinityBowtie(p * 1.5) / 1.5;
    float body = smin(body1, body2, 0.5);

    // Add the 30 intelligent legs
    float legs = sdLegs(p);

    return smin(body, legs, 0.3);
}

// Color Palette
vec3 getPalette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.263, 0.416, 0.557);
    return a + b * cos(6.28318 * (c * t + d + iTime * 0.1));
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float time = iTime * u_speed;

    // 1. CAMERA SYSTEM (Parallel Rail)
    float angle = time * 0.2;
    vec3 ro = vec3(sin(angle) * u_camera_dist, 2.0 + cos(angle * 0.5) * 2.0, cos(angle) * u_camera_dist);
    vec3 ta = vec3(0.0, 0.0, 0.0);

    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f * u_fov + uv.x * r + uv.y * u);

    // 2. RAYMARCHING
    float t = 0.0;
    float glow = 0.0;
    float d = 0.0;
    vec3 p;

    for(int i = 0; i < 90; i++) { // Increased iterations slightly for legs
        p = ro + rd * t;
        d = map(p);

        // Accumulate glow based on proximity to surface
        glow += 0.04 / (0.08 + abs(d));

        if(abs(d) < 0.001 || t > 30.0) break;
        t += d * 0.75; // Slightly more conservative for the complex leg geometry
    }

    // 3. COLORING & FADING
    vec3 col = vec3(0.0);

    // Background Gradient
    col = mix(vec3(0.01, 0.02, 0.05), vec3(0.0), length(uv));

    if(t < 30.0) {
        // Calculate Normal for shading
        vec2 e = vec2(0.01, 0.0);
        vec3 n = normalize(vec3(
            map(p + e.xyy) - map(p - e.xyy),
            map(p + e.yxy) - map(p - e.yxy),
            map(p + e.yyx) - map(p - e.yyx)
        ));

        float diff = max(dot(n, normalize(vec3(1, 2, 3))), 0.0);
        float fresnel = pow(1.0 - max(dot(n, -rd), 0.0), 4.0);

        vec3 baseCol = getPalette(p.y * 0.15 + time * 0.1);
        col = baseCol * diff;
        col += fresnel * baseCol * 2.0;

        // Add a bit of rim light to make legs pop
        col += pow(fresnel, 2.0) * vec3(0.5, 0.8, 1.0);
    }

    // Apply smooth glow and volumetric fade
    vec3 glowCol = getPalette(time * 0.05) * glow * u_glow_intensity;
    col += glowCol * 0.15;

    // Atmosphere / Distance Fade
    col = mix(col, vec3(0.0, 0.01, 0.02), 1.0 - exp(-0.04 * t));

    // Contrast and Gamma Correction
    col = pow(col, vec3(0.8));
    col *= 1.2;

    fragColor = vec4(col, 1.0);
}
